import React, { Component } from 'react';
import logo from '../logo.svg';
import '../App.css';

import {BrowserRouter as Router, Route} from 'react-router-dom';

const News = ({match}) => {
  return (
<h1>News Page > { match.params.id} > { match.params.id}</h1> 
    )
}

class App extends Component {

  render() {
    return (
   <Router>
   <div>
   <Route path="/"  exact render= {() => { return(<h1>Homepage</h1>)}}>
   </Route>
   <Route path="/contact"  exact render= {() => { return(<h1>Contact</h1>)}}>
   </Route>

   <Route path="/news/:id"  exact component= {News}>
   </Route>

   </div>
   </Router>
    );
  }
}

export default App;
